import React from 'react';
import { TextField, Grid } from '@mui/material'

const Input = ({ name, handleChange, label, autoFocus, type, required }) => (
  <Grid item xs={12} sm={12}>
    <TextField
      name={name}
      onChange={handleChange}
      variant="outlined"
      required={required}
      fullWidth
      label={label}
      autoFocus={autoFocus}
      type={type}
    />
  </Grid>
);

export default Input;
